import ExpensItem from "./components/ExpenseItem";

function App() {
  const expense = [
    {
      title: "Car Insurance",
      amount: 125.5,
      date: new Date(2021, 11, 13),
    },
    {
      title: "Machanical Repairs",
      amount: 165.75,
      date: new Date(2022, 2, 27),
    },
    {
      title: "Car Insurance",
      amount: 155.20,
      date: new Date(2022, 3, 23),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpensItem
        title={expense[0].title}
        amount={expense[0].amount}
        date={expense[0].date}
      />
      <ExpensItem
        title={expense[1].title}
        amount={expense[1].amount}
        date={expense[1].date}
      />
      <ExpensItem
        title={expense[2].title}
        amount={expense[2].amount}
        date={expense[2].date}
      />
    </div>
  );
}

export default App;
